import { brake, oil, tire, battery } from 'images/tips';
import {a,b,c,d,r,f,ff} from 'images/gallery/index'

export type GalleryItem = {
  src: string;
  alt: string;
  caption?: string;
};

export const gallery: GalleryItem[] = [
  { src: a, alt: 'Motor recondiționat, compartiment curat', caption: 'Recondiționare motor' },
  { src: b, alt: 'Schimb plăcuțe și discuri frână', caption: 'Frâne noi' },
  { src: c, alt: 'Service A/C – încărcare freon', caption: 'Climatizare' },
  { src: d, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: r, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: f, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: ff, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: fff, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: battery, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: tire, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: oil, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
  { src: brake, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
];

export const galleryExtended: GalleryItem[] = Array(5)
  .fill(gallery)
  .flat();
